import { useEffect, useState } from "react";

export const Menu = () => {
    const [usuario, setUsuario] = useState(null);

    useEffect(() => {
        const usuarioStorage = localStorage.getItem("usuario");
        if (usuarioStorage) {
            setUsuario(JSON.parse(usuarioStorage));
        }
    }, []);

    if (!usuario) return <p>Carregando...</p>;

    const handleLogout = () => {
        localStorage.removeItem("usuario");
        window.location.reload();
    };

    return (
        <main style={{ display: "flex", minHeight: "100vh" }}> {/*Conteudo da direita :D*/}
            <Sidebar usuario={usuario} onLogout={handleLogout} />
            <section style={{ flex: 1, padding: "2rem" }}>
                Seja bem-vindo devolta, <b>{usuario.nome}</b>
            </section>
        </main>
    );
};

const Sidebar = ({ usuario, onLogout }) => (
    <aside style={{ width: "220px", background: "#f5f5f5", padding: "2rem 1rem", display: "flex", flexDirection: "column", justifyContent: "space-between"}} >
        <nav>
            <ul style={{ listStyle: "none", padding: 0 }}>
                <li>
                    <h4 style={{ textAlign: "center" }}>Menu</h4>
                </li>
                <li>
                    <a href="#dashboard">Dashboard</a>
                </li>
                <li>
                    <a href="#eventos">Eventos</a>
                </li>
                <li>
                    <a href="#equipes">Equipes</a>
                </li>
                <li>
                    <a href="#inscricao">InscriÃ§Ãµes</a>
                </li>
            </ul>
        </nav>

        <div
            style={{ display: "flex", flexDirection: "column", gap: "0.5rem", marginTop: "2rem"}}>
        <UserProfile usuario={usuario} />

            <button style={{padding: "0.5rem", borderRadius: "4px", border: "none", background: "#e0e0e0", cursor: "pointer"}}>
                ConfiguraÃ§Ãµes
            </button>
            <button style={{padding: "0.5rem", borderRadius: "4px", border: "none", background: "#ff5252", color: "#fff", cursor: "pointer"}}
                onClick={onLogout}>
                Sair
            </button>
        </div>
    </aside>
    
);

const UserProfile = ({ usuario }) => (
    <div style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            marginTop: "2rem",
        }}
    >
        <div
            style={{
                display: "grid",
                gridTemplateColumns: "34px 1fr",
                alignItems: "center",
                gap: "0.75rem",
                width: "100%",
            }}
        >
            <img
                src={usuario.fotoPerfil}
                alt="Foto de Perfil"
                style={{ width: 34, height: 34, borderRadius: "50%" }}
            />
            <div style={{ display: "flex", flexDirection: "column" }}>
                <span style={{ fontWeight: "bold" }}>{usuario.nome}</span>
                <span style={{ fontSize: "0.9em", color: "#888" }}>
                    {usuario.admin ? "Administrador" : "UsuÃ¡rio"}
                </span>
            </div>
        </div>
    </div>
);
